import React from 'react';

import {
    Grid,
    Typography,
    Button,
} from '@material-ui/core';

const Temp = () => {

    return (
        <Grid container>

            <Grid item xs={12}>
                <Button>
                    <Typography>
                        Welcome
                    </Typography>
                </Button>
            </Grid>

        </Grid>
    );
};

export default Temp;
